import Menu from './components/Menu'
import Panel from './Panel';
import About from './components/About'
import Skills from './components/Skills';



function App() {
  return (
    <div className="App">
      {Menu()} {About()}      {Panel()} {Skills()}

    </div>
  );
}

export default App;
